import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import FilterListContextProvider from './context/FilterListContext';
import FilterSidebarContext from './context/FilterSidebarContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>      <FilterSidebarContext>
    <FilterListContextProvider>

        <App />

    </FilterListContextProvider>      </FilterSidebarContext>
  </React.StrictMode>
);
